import React from 'react';
import '../styles/home.css';
import Logo from '../images/sample-logo.jpeg';

function Home() {
  return (
    <div>
      <header>
        <img
          alt="Guilherme Castelo Branco Logo"
          className="img-logo"
          src={ Logo }
        />
      </header>
      <nav>
        <h1>Home</h1>
      </nav>
    </div>
  );
}

export default Home;
